“trabaiamos el estribillo en el lenguaje en que hablan los cubanos.
Para este video de Uyuyuy qué veo la Revé invita a grandes de la música cubana, cuyas trayectorias artísticas reflejan también el vínculo ineludible con la cultura de la isla, como Roberto Hernandez Acea, el Robertón de los Van Van; Abdel Rasalps, EI Lele de los Van 
